
public class DoLoop {

	/**
	 * @param args
	 */
	//if it is a do while loop it will execute atlest one time what we given at the do loop
	public static void main(String[] args) {
		// TODO Auto-generated method stub
int num=1;
do{
	System.out.println(num);
	num++;
}while(num<1);
System.out.println("end");
	}

}
